import React, { useState, useContext } from 'react';
import { useNavigate, Link as RouterLink } from 'react-router-dom';
import {
  Container,
  Box,
  Typography,
  TextField,
  Button,
  Link,
  Paper,
  Alert,
  CircularProgress
} from '@mui/material';
import { AuthContext } from '../context/AuthContext';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [formErrors, setFormErrors] = useState({});
  const [showMockLoginOptions, setShowMockLoginOptions] = useState(false);
  const { login, loading, error } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });

    // Clear error when user types
    if (formErrors[name]) {
      setFormErrors({
        ...formErrors,
        [name]: ''
      });
    }
  };

  const validateForm = () => {
    const errors = {};

    if (!formData.email) {
      errors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
      errors.email = 'Email is invalid';
    }

    if (!formData.password) {
      errors.password = 'Password is required';
    }

    setFormErrors(errors);
    return Object.keys(errors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (validateForm()) {
      const success = await login(formData.email, formData.password);
      if (success) {
        navigate('/');
      }
    }
  };

  const handleMockLogin = async (role) => {
    console.log('Mock login with role:', role);

    // Create a mock JWT token with the specified role
    const header = btoa(JSON.stringify({ alg: 'HS256', typ: 'JWT' }));
    const payload = btoa(JSON.stringify({
      sub: '1',
      email: role === 'ADMIN' ? 'admin@example.com' : 'user@example.com',
      name: role === 'ADMIN' ? 'Admin User' : 'Regular User',
      role: role,
      exp: Math.floor(Date.now() / 1000) + (60 * 60) // 1 hour from now
    }));
    const signature = btoa('mock_signature');
    const token = `${header}.${payload}.${signature}`;

    console.log('Generated mock token:', token);
    console.log('Token payload:', {
      sub: '1',
      email: role === 'ADMIN' ? 'admin@example.com' : 'user@example.com',
      name: role === 'ADMIN' ? 'Admin User' : 'Regular User',
      role: role,
      exp: Math.floor(Date.now() / 1000) + (60 * 60) // 1 hour from now
    });

    localStorage.setItem('token', token);
    window.location.href = '/'; // Force a full page reload to update the auth state
  };

  return (
    <Container maxWidth="sm">
      <Box sx={{ mt: 8, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <Paper sx={{ p: 4, width: '100%' }}>
          <Typography component="h1" variant="h4" align="center" gutterBottom>
            Library Management System
          </Typography>
          <Typography component="h2" variant="h5" align="center" gutterBottom>
            Sign In
          </Typography>

          {error && (
            <Alert severity="error" sx={{ mb: 2 }}>
              {error}
            </Alert>
          )}

          <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
            <TextField
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
              value={formData.email}
              onChange={handleChange}
              error={!!formErrors.email}
              helperText={formErrors.email}
            />
            <TextField
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
              value={formData.password}
              onChange={handleChange}
              error={!!formErrors.password}
              helperText={formErrors.password}
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
              disabled={loading}
            >
              {loading ? <CircularProgress size={24} /> : 'Sign In'}
            </Button>

            <Box sx={{ mt: 2, textAlign: 'center' }}>
              <Link component={RouterLink} to="/register" variant="body2">
                {"Don't have an account? Sign Up"}
              </Link>
            </Box>

            <Box sx={{ mt: 3, textAlign: 'center' }}>
              <Button 
                variant="text" 
                color="secondary"
                onClick={() => setShowMockLoginOptions(!showMockLoginOptions)}
              >
                {showMockLoginOptions ? 'Hide Mock Login Options' : 'Show Mock Login Options'}
              </Button>
            </Box>

            {showMockLoginOptions && (
              <Box sx={{ mt: 2, display: 'flex', justifyContent: 'space-between' }}>
                <Button 
                  variant="outlined" 
                  color="primary"
                  onClick={() => handleMockLogin('USER')}
                  sx={{ width: '48%' }}
                >
                  Login as User
                </Button>
                <Button 
                  variant="outlined" 
                  color="secondary"
                  onClick={() => handleMockLogin('ADMIN')}
                  sx={{ width: '48%' }}
                >
                  Login as Admin
                </Button>
              </Box>
            )}
          </Box>
        </Paper>
      </Box>
    </Container>
  );
};

export default Login;
